Dylan Ryder &amp; Tiffany Tyler - ROB THIS! BITCH!
Added: September 28, 2010

&quot;Dylan and Tiffany are elusive burglars on the run from the law with nothing to lose but each other. After a bank robbery where Dylan overly acts out, they return to their hideout to find their faces plastered all over the news. Tiffany decides it's time to give up the life of a fugitive. This sends Dylan off the deep end and is forced to remind Tiffany who is in charge of decision making.&quot;
